package doancuoiky.model;

import java.util.Date;

public class DangKyNoiTru {
	 	private String maDV;
	    private String maNguoiDung;
	    private String namHoc;
	    private String hocKy;
	    private String phong;
	    private int lau;
	    private String khu;
	    private Date ngayVaoKTX;
	    private String trangThai;

	    public DangKyNoiTru() {
	        // TODO Auto-generated constructor stub
	    }

	    public String getMaDV() {
	        return maDV;
	    }

	    public void setMaDV(String maDV) {
	        this.maDV = maDV;
	    }

	    public String getMaNguoiDung() {
	        return maNguoiDung;
	    }

	    public void setMaNguoiDung(String maNguoiDung) {
	        this.maNguoiDung = maNguoiDung;
	    }

	    public String getNamHoc() {
	        return namHoc;
	    }

	    public void setNamHoc(String namHoc) {
	        this.namHoc = namHoc;
	    }

	    public String getHocKy() {
	        return hocKy;
	    }

	    public void setHocKy(String hocKy) {
	        this.hocKy = hocKy;
	    }

	    public String getPhong() {
	        return phong;
	    }

	    public void setPhong(String phong) {
	        this.phong = phong;
	    }

	    public int getLau() {
	        return lau;
	    }

	    public void setLau(int lau) {
	        this.lau = lau;
	    }

	    public String getKhu() {
	        return khu;
	    }

	    public void setKhu(String khu) {
	        this.khu = khu;
	    }
	    public Date getNgayVaoKTX() {
	        return ngayVaoKTX;
	    }

	    public void setNgayVaoKTX(Date ngayVaoKTX) {
	        this.ngayVaoKTX = ngayVaoKTX;
	    }

	    public String getTrangThai() {
	        return trangThai;
	    }

	    public void setTrangThai(String trangThai) {
	        this.trangThai = trangThai;
	    }
}
